import React from 'react';
import CardList from './CardList';
import SearcBox from './SearchBox';
import { robots } from './robots';

const App = () => {
    return(
        <div className='tc'>
            <h1>RoboFriends</h1>
            <SearcBox />
            <CardList robots={robots} />
        </div>
    );
}

export default App;
